Tables are sinks of data. At the lowest form they are wrappers around concurrent maps that offer some value add in propogating updates and deletes for through the system. Data tables are represented by the interface io.venuu.vuu.core.table.DataTable in the source code. trait DataTable extends KeyedObservable[RowKeyUpdate] with RowSource { @volatile private var provider: Provider = null def indexForColumn(column: Column): Option[IndexedField[_]] def setProvider(aProvider: Provider): Unit = provider = aProvider def getProvider: Provider = provider def asTable: DataTable = this def columnForName(name: String): Column = getTableDef.columnForName(name) def columnsForNames(names: String*): List[Column] = names.map(getTableDef.columnForName(_)).toList def columnsForNames(names: List[String]): List[Column] = names.map(getTableDef.columnForName(_)) def getTableDef: TableDef def processUpdate(rowKey: String, rowUpdate: RowWithData, timeStamp: Long): Unit def processDelete(rowKey: String): Unit def isSelectedVal(key: String, selected: Map[String, Any]): Int = { if (selected.contains(key)) 1 else 0 } def size(): Long = { primaryKeys.length } def toAscii(count: Int): String = { val columns = getTableDef.columns val keys = primaryKeys val selectedKeys = keys.toArray.take(count) val rows = selectedKeys.map(key => pullRowAsArray(key, columns.toList)) val columnNames = columns.map(_.name) AsciiUtil.asAsciiTable(columnNames, rows) } def toAscii(start: Int, end: Int): String = { val columns = getTableDef.columns val keys = primaryKeys val selectedKeys = keys.toArray.slice(start, end)//.slice(start, end)//drop(start).take(end - start) val rows = selectedKeys.map(key => pullRowAsArray(key, columns.toList)) val columnNames = columns.map(_.name) AsciiUtil.asAsciiTable(columnNames, rows) }
} The important methods from this train for these purposes are: def processUpdate(...)
def processDelete(...) These are the methods that you call in a provider to populate data into the underlying map. If you go back to the Providers example you can see it is indeed the update method being called. processUpdate functions like an upsert in a SQL data (i.e. it is used for both an insert and an update) #Types of Table #(Simple) Table Simple Tables (the default table type, defined by using the TableDef() class) are sinks for data. They are wrappers around a concurrent map and are mechanisms to propogate update or delete events to join tables and view ports. #Join Tables Join tables represent the logical joining of two separate tables into a single merged table. In practice they are mappings of keys from one table to keys from one or more other tables. When data is realised (i.e. sent down to a user's ui via the websocket) the relevant rows are realized by dragging the data from the underlying simple tables. #AutoSubscribe Table Auto subscriber tables are simple data tables that when involved in a join will receive a special callback as part of the join process to load data from a n external source by primary key. An example of an auto subscribe table would be where we have an external source, such as market data, that we only want to subscribe to if we have any other data like orders on particular symbols. When we join orders and prices, if the prices tables is defined as an auto subscribe table, we will make a call to the autosubscribe table with the product symbol on the order once each time a new order is entered. #Lucene Table TODO: Lucene tables are a work in progress, whach this space.

